import React, { Children } from 'react';
import { Menu, Input } from 'antd';

const AppLayout = () => {
    return(
        <>
            <Menu>
                <Menu.Itme key="home">노드버드</Menu.Itme>
                <Menu.Itme key="profile">프로필</Menu.Itme>
                <Menu.Itme key="mail">
                    <Input.Search enterButton />
                </Menu.Itme>
            </Menu>
            {children}
        </>
    );
};

export default AppLayout;
